export default {

	getFinalisedListString: () => {
		var ret = ""
		for (const chr in listFinalisedLocations.selectedItem) {
			ret = ret + listFinalisedLocations.selectedItem[chr]
		}
		return ret
	},
	getCountedListString: () => {
		var ret = ""
		for (const chr in listCountedLocations.selectedItem) {
			ret = ret + listCountedLocations.selectedItem[chr]
		}
		return ret
	},
	getUncountedListString: () => {
		var ret = ""
		for (const chr in listUncountedLocations.selectedItem) {
			ret = ret + listUncountedLocations.selectedItem[chr]
		}
		return ret
	}
}
